import React from "react";
import styled from "@emotion/styled";

const Page = styled.div`
  width: 300px;
  margin: 0 auto;
`;

const Title = styled.h1`
  color: #333;
`;

const MessageForm = styled.form`
  margin-top: 16px;
`;

function App() {
  return;
  <Page>
    <Title>留言板</Title>
    <MessageForm>
      <MessageTextArea />
    </MessageForm>
    <MessageList>
      <Message></Message>
    </MessageList>
  </Page>;
}

export default App;
